import ContentCss from "./content.module.css";

function Content(props) {
  return (
    <>
      <div className={HeaderCss.container2}>
        <div>
          <img src={props.imageSrc} alt="An image" />
          <p>{props.string1}</p>
          <p>{props.string2}</p>
        </div>
      </div>
    </>
  );
}

export default Content;
